pragma solidity ^0.8.0;

import '../src/AddressManagerRecieverMini.sol';
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";


// This contract enables anyone to be able to submit dispute proposals, regardless of thier membership status.

contract CourtClerk is AddressManagerRecieverMini {

    constructor(address _addressManagerAddress) AddressManagerRecieverMini(_addressManagerAddress) {
        updateAllAddresses();
    }

    function submitDispute(uint _tokenId, address _badgeAddress, bytes calldata _minionCallData) public returns (bytes memory proposalIdBytes) {
        ERC721 badge = ERC721(_badgeAddress);
        require(msg.sender == badge.ownerOf(_tokenId));
        proposalIdBytes = _sendMinionTransaction(_minionCallData);
        //require(proposalId > 0, "Check proposalId");
        return proposalIdBytes;
    }

    function _sendMinionTransaction(bytes calldata _minionCallData)internal returns (bytes memory proposalIdBytes) {

        (bool success, bytes memory toReturn) = JuryDAOAddress.call(_minionCallData);
        proposalIdBytes = toReturn;
        //require (proposalId >= 1, "Error sending tx to minion");
        require(success, "Tx not submitted to minion");
        return proposalIdBytes;

    }

    function requestMembership() internal returns (bool) {
        require(_requestMembership(), "error");
        return true;
    }

    function _requestMembership() internal returns (bool) {

        bytes memory txEncoded = abi.encodeWithSignature(
            "submitProposal(address, uint256, uint256, uint256, address, uint256, address, string)",
            address(this), 1, 0, 0, 0xe78AC7E8d309C749EBC80F55A78B3b397625421C, 0, 0xe78AC7E8d309C749EBC80F55A78B3b397625421C,
            "hire the clerk"
        );

        JuryDAOAddress.call(txEncoded);
        return true;
    }

}
